import React from "react";
import Main from "./Components/Main";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import InsideProjectPage from "./Components/Project/InsideProjectPage/InsideProjectPage";

const App = () => {
  return (
    <div>
      <Main />
      <Router>
      <Routes>
        <Route path="/inside-project" element={<InsideProjectPage />} />

      </Routes>
    </Router>
    </div>
  );
};

export default App;
